;
L.Control.w3w = L.Control.extend({
	options: {
		position: 'bottomleft',
		locationText:'- - -',
		promptText: 'Press Ctrl+C to copy location',
		precision: 4,
		apikey : "YOURAPIKEY" //your api key
	},

	initialize: function(options)
	{
		L.Control.prototype.initialize.call(this, options);
	},

	onAdd: function(map)
	{
		var className = 'leaflet-control-w3w',
			that = this,
			container = this._container = L.DomUtil.create('div', className);
		this.visible = false;

		L.DomUtil.addClass(container, 'hidden');
		L.DomEvent.disableClickPropagation(container);
		this._addText(container, map);

		L.DomEvent.addListener(container, 'click', function() {
			window.prompt("Copy to clipboard: Ctrl+C, Enter", L.DomUtil.get(this._locationText).dataset.words);
    	}, this);
		return container;
	},

	_addText: function(container, context)
	{
		this._locationText = L.DomUtil.create('span', 'leaflet-control-w3w-locationText' , container);
		L.DomUtil.get(this._locationText).innerHTML = '<strong>w3w:</strong> ' + this.options.locationText;
		return container;
	},

	_getWords: function(obj,locText){
			var getJSON = function(url, successHandler, errorHandler) {
			 var xhr = typeof XMLHttpRequest != 'undefined' ? new XMLHttpRequest() : new ActiveXObject('Microsoft.XMLHTTP');
			  xhr.open('get', url, true);
			  xhr.responseType = 'json';
			  xhr.onreadystatechange = function() {
			    var status;
			    var data;
			    if (xhr.readyState == 4) {
			      status = xhr.status;
			      if (status == 200) {
			        successHandler && successHandler(xhr.response);
			      } else {
			        errorHandler && errorHandler(status);
			      }
			    }
			  };
			  xhr.send();
			};

			getJSON('//api.what3words.com/position?key='+this.options.apikey+'&position='+obj.lat+','+obj.lng, function(data) {
			  locText.innerHTML = '<strong>w3w:</strong> ' + data.words[0] + " " + data.words[1] + " " + data.words[2];
			  locText.dataset.words =("data-",  data.words[0] + " " + data.words[1] + " " + data.words[2]);

			}, function(status) {
			  console.log('Something went wrong.');
			});
	},

	setCoordinates: function(obj)
	{
		if (!this.visible) {
			L.DomUtil.removeClass(this._container, 'hidden');
		}
		if (obj.latlng) {
			this._getWords(obj.latlng,L.DomUtil.get(this._locationText));
		}
	}
});
/* exported utility */


window.COPO = window.COPO || {};

COPO.utility = {
  urlParam: function(name){
    var results = new RegExp('[\?&]' + name + '=([^&#]*)').exec(window.location.href);
    if (!results) return null;
    return results[1] || 0;
  },

  ujsLink: function(verb, text, path){
    var output =  $('<a data-remote="true" rel="nofollow" data-method="' + verb +'" href="' + path +'">' + text +'</a>')
    return output
  },

  deleteCheckinLink: function(checkin){
    return COPO.utility.ujsLink('delete',
      '<i class="material-icons right red-text">delete_forever</i>' ,
      window.location.pathname + '/checkins/' + checkin.id )
      .attr('data-confirm', 'Are you sure?').prop('outerHTML')
  },

  fogCheckinLink: function(checkin, foggedClass, fogId){
    return COPO.utility.ujsLink('put',
      '<i class="material-icons">cloud</i>' ,
      window.location.pathname + '/checkins/' + checkin.id )
      .attr('id', fogId + checkin.id).attr('class', foggedClass).prop('outerHTML')
  },

  createCheckinLink: function(coords){
    var checkin = {
      'checkin[lat]': coords.lat.toFixed(6),
      'checkin[lng]': coords.lng.toFixed(6)
    }
    var checkinPath = location.pathname + '/checkins?' + $.param(checkin);
    return COPO.utility.ujsLink('post', 'Create checkin here', checkinPath).prop('outerHTML');
  },

  friendsName: function(friend){
    return friend.username ? friend.username : friend.email.split('@')[0]
  },

  fadeUp: function(target){
    $(target).velocity({
      opacity: 0,
      marginTop: '-40px'
    }, {
      duration: 375,
      easing: 'easeOutExpo',
      queue: false,
      complete: function(){
        $(target).remove();
      }
    });
  },

  avatar: function(avatar, customOptions){

    var defaultOptions = {
      width: 60,
      height: 60,
      crop: 'fill',
      radius: 'max',
      gravity: 'face:center'
    }

    var options = $.extend(defaultOptions, customOptions)

    if(avatar && avatar.hasOwnProperty('public_id')) {
      return $.cloudinary.image(avatar.public_id, options).prop('outerHTML')
    } else {
      return $.cloudinary.image("placeholder_wzhvlw.png", options).prop('outerHTML')
    }
  },

  initClipboard: function(selector, callback){

    selector = selector || '.clip_button';
    var client = new ZeroClipboard( $(selector) );

    client.on( 'ready', function(event) {
      // console.log( 'movie is loaded' );
      $('.clip_button').removeClass('hide');

      client.on( 'copy', function(event) {
        event.clipboardData.setData('text/plain', event.target.value);
      });

      callback = callback || function(event){
        $('.material-tooltip').children('span').text('Copied');
      }

      client.on( 'aftercopy', function(event) {
        callback(event);
      });

    });

    client.on( 'error', function(event) {
      console.log( 'ZeroClipboard error of type "' + event.name + '": ' + event.message );
      ZeroClipboard.destroy();
    });
  }
};
