function responsiveVideo(){
  var ratio = 1920/1080;
  var $h = $(".promo").height();
  var $w = $(".promo").width();
  var rRatio = $w/$h;

  if(rRatio < ratio){
    // Aspect ratio is lower than 16:9
    $(".promo video").css({
      width: 'auto',
      height: '100%'
    });
  }else{
    // Aspect ration is higher than 16:9
    $(".promo video").css({
      width: '100%',
      height: 'auto'
    });
  }
}
